import React, { useEffect, useRef, useState } from "react";

import Header from "./Header";
import Footer from "./Footer";
import Home from "./Home";
import DrawStudio from "./DrawStudio";
import ShowAvailable from "./ShowAvailble";

import "../styles/layout.css"


type Object = {
    x: number;
    y: number;
    type: "chair" | "table" | "sitting";
};

type Info = {
    time: number
    now?: number
    data: Object[]
}

type Props = {
	objects: Info;
};

const DesktopLayout = ({props} : any) => {
    const [data, setData] = useState<Props[]>([])

    const getData = async () => {
        const res = await fetch(
            "http://10.18.243.73:3000/data"
        ).then((res) => {
            try{
                console.log(res.json())
            }
            catch (e) {
                console.log(e)
            }
            return res.json()
        })

        const initData = res.map((it: any):Props => {
            const info:Info = {
                time: it.time,
                data: it.data.map((object:any) => ({
                    x: object.x,
                    y: object.y,
                    type: object.type
                })),
                now: new Date().getTime()
            }

            const props: Props = {
                objects: info,
            }

            return props
        })
        setData(initData)
    }

    useEffect(() => {
        getData()
        console.log(data)
    }, [])

    return (
        <>
            <Header />
            <div className="container_desktop">
                <div className="left_desktop">
                    <div>
                        {data.map((it: any) =>{
                            return (<DrawStudio objects={it}/> )
                        })}
                    </div>
                    <div className="left_bottom">
                        <p>최근 업데이트 시점: {}</p>
                        <button> 새로고침 </button>
                    </div>
                </div>
                <div className="right_desktop">
                </div>
            </div>
            <Footer />
        </>
    )
}

export default DesktopLayout
